import React from 'react'
import { Container, Col } from 'react-bootstrap'

function Leftbar() {
    return ( 
      <Col md={2} className="leftbar" style={{background:"red", height:"800pt", padding: "100pt 0", position: "fixed"}}>
        <h1>Hello</h1>
      </Col>
     );
  }

export default function Cover() {
  return (
    <Col md={10}>
        <Container>
            <h1>Projects</h1>
        </Container>
    </Col>
  )
}
